import logo from "./logo.svg";
import "./App.css";
import {Routes, Route } from "react-router";
import Homepage from "./components/Homepage";
function App() {
  return (
    <div className="App">
    <Router></Router>
      <Routes>
        <Route path="/" element={<Homepage />} />
      </Routes>
    </div>
  );
}

export default App;
